$data[1] = "INSERT INTO `activity` VALUES ( '13', '182', 'Круглый стол &laquo;Перспективы развития Южной Осетии после признания ее независимости&raquo;', '<p style=\"text-align: justify;\">&nbsp; 19 мая 2009 года в РИСИ прошел круглый стол на тему <b>&laquo;Перспективы развития Южной Осетии после признания ее независимости&raquo;</b>,на котором с докладом выступил <i>заместитель председателя парламента Республики Южная Осетия</i> <b>ДЗИЦЦОЙТЫ Юрий Альбертович</b>. В мероприятии приняли участие <i>эксперты Центра Кавказских исследований МГИМО &ndash; старший научный сотрудник</i> <b>ЗАХАРОВ Владимир Александрович</b> и <i>старший научный сотрудник</i> <b>СИЛАЕВ Николай Юрьевич</b>, <i>ведущий научный сотрудник ИМЭМО РАН</i> <b>КРЫЛОВ Александр Борисович</b>, а также эксперты РИСИ.</p>
<p style=\"text-align: justify;\">Круглый стол открыл первый заместитель директора РИСИ КОКАРЕВ Константин Анатольевич. В своем выступлении К. А. Кокарев отметил чрезвычайную важность Южной Осетии с точки зрения перспектив развития и региона Закавказья, и России. Республика переживает сейчас очень сложный период становления своей государственности, перед руководством стоят проблемы экономического, политического и социального развития страны. Необходимо восстанавливать разрушенные дома, инфраструктуру, создавать новые рабочие места, повышать жизненный уровень населения. Особые отношения Южной Осетии с Россией позволяют ей рассчитывать на нашу экономическую, политическую и моральную помощь. При этом К. А. Кокарев отметил, что усилия России в регионе и в частности в отношении Южной Осетии находятся в полном соответствии с положениями Стратегии национальной безопасности РФ до 2020 года. По мнению К. А. Кокарева, многие аспекты происходящего еще ждут своей беспристрастной оценки, но для этого требуется время. Однако феномен Южной Осетии имеет важное значение не только для развития Закавказья, но и, как считают некоторые эксперты, для развития отдельных регионов мира.<br />
В своем выступлении вице-спикер парламента Южной Осетии Ю. А. Дзиццойты рассказал об особенностях обстановки в Южной Осетии, о деятельности парламентских структур и подготовке к проведению пятых выборов в законодательный орган республики, но первых в условиях признанности государства.<br />
Как сказал Ю. А. Дзиццойты, нападение Грузии на Южную Осетию в ночь на 8 августа 2008 года было легко прогнозируемым &ndash; грузинское руководством с момента прихода к власти придерживалось курса на вооружение страны, переоснащение ее вооруженных сил, в котором участвовали и отдельные западные государства.<br />
На сегодняшний день Южная Осетия &ndash; это признанное государство и со стороны России это был &laquo;мужественный шаг&raquo;. Однако перед Республикой стоят очень серьезные проблемы &ndash; необходимо восстановить разрушенное жилье и инфраструктуру. Многое уже удалось сделать &ndash; по словам Ю. А. Дзиццойты, в домах, подлежащих восстановлению, заменено 80 % кровли, у населения есть вода, свет, газ. Интенсивными темпами идет строительство газопровода Дзуарикау &ndash; Цхинвал, что поможет Республике стать независимой от Грузии в вопросе поставок газа.<br />
Однако Ю. А. Дзиццойты подчеркнул, что самостоятельно, без помощи России Южная Осетия не сможет решить имеющиеся проблемы. Между Россией и Южной Осетией заключен Большой договор, который предполагает дальнейшую конкретизацию отдельных областей и вопросов сотрудничества. В частности, 30 апреля, сразу после подписания президентами Российской Федерации и Южной Осетии договоренности о совместных усилиях по охране государственных границ, сотрудники подразделений пограничных войск РФ приступили к работе.<br />
В республике, по словам Ю. А. Дзиццойты, остро стоит проблема безработицы, выбор у молодежи невелик: уезжать на заработки в Северную Осетию и Россию или заниматься криминальной деятельностью. Поэтому развитие промышленного производства в Республике, создание рабочих мест жизненно необходимо.<br />
Ю. А. Дзиццойты отметил, что одним из приоритетов руководства Южной Осетии является проблема Ленингорского района, который во времена СССР был отрезан от основной территории Республики и транспортное сообщение с ним было возможно лишь по территории Грузии. На сегодняшний день проложена грунтовая дорога и в хорошую погоду из Цхинвала до Ленингора можно добраться за 3-4 часа. Другая проблема района связана с его населением. Как сказал Ю. А. Дзиццойты, на протяжении всего советского периода Грузия проводила политику ассимиляции осетинского населения Ленингорского района. Обучение в школах велось только на грузинском языке. Уже после распада Советского Союза Институт истории и этнографии Академии наук Грузии выдавал живущим в районе осетинам официальные справки, свидетельствующие об &laquo;исконно грузинском происхождении&raquo; той или иной осетинской фамилии. Осознавая деликатность имеющейся проблемы, руководство Южной Осетии настроено на кропотливую работу по интеграции и грузинского, и осетинского населения Ленингорского района в южноосетинское общество.<br />
Актуальна для Южной Осетии и проблема беженцев. В Республику вернулись не все, бежавшие во время августовских событий. Продолжается и приток осетинского населения из Грузии. При этом, как утверждает Ю. А. Дзиццойты, руководство страны выступает за возвращение как осетинских, так и грузинских беженцев.<br />
Оценивая ситуацию вокруг признания независимости Южной Осетии и Абхазии Ю. А. Дзиццойты, отметил, что руководство Республики рассчитывает на дальнейшее международное признание, понимая, что этому процессу активно противодействуют США и ЕС. Ярким примером тому стал жесткий нажим на Белоруссию, парламент которой был готов положительно решить данный вопрос.<br />
Одним из важнейших вопросов российско-южноосетинского сотрудничества является взаимодействие в транспортной сфере. Любые вопросы &ndash; экономические, военные, политические, тем или иным образом подразумевают необходимость скорейшего развития двусторонних транспортных связей. О текущем состоянии дел в этой сфере и основных направлениях, реализация которых необходима в ближайшее время, выступила старший научный сотрудник РИСИ К. Е. Каратаева. <a href=\"http://web.riss.ru/doklady_i_vystuplenija/?newsId=46\">Подробнее&hellip;<br />
</a>На круглом столе была затронута, в том числе, и тема взаимоотношений США и НАТО с Грузией. В частности, в выступлении научного сотрудника РИСИ С. М. Ермакова прозвучала мысль о том, что Североатлантический союз проводит последовательный курс на сближение с Грузией, не прерванный даже после августовских событий 2008 года. Можно констатировать, что по-прежнему Тбилиси является наиболее активным партнером альянса на Кавказе, а интеграция в структуры НАТО &ndash; приоритетная цель грузинской внешней политики. <a href=\"http://web.riss.ru/doklady_i_vystuplenija/?newsId=47\">Подробнее&hellip;</a><br />
Свой взгляд на политику США в отношении Грузии и Южной Осетии после &laquo;пятидневной войны&raquo; представил старший научный сотрудник РИСИ&nbsp;С.А. Михайлов. <a href=\"http://web.riss.ru/doklady_i_vystuplenija/?newsId=48\">Подробнее&hellip;</a></p>', '<p style=\"text-align: justify;\">&nbsp;19 мая 2009 года в РИСИ прошел круглый стол на тему <b>&laquo;Перспективы развития Южной Осетии после признания ее независимости&raquo;</b>,на котором с докладом выступил <i>заместитель председателя парламента Республики Южная Осетия</i> <b>ДЗИЦЦОЙТЫ Юрий Альбертович</b>. В мероприятии приняли участие <i>эксперты Центра Кавказских исследований МГИМО &ndash; старший научный сотрудник</i> <b>ЗАХАРОВ Владимир Александрович</b> и <i>старший научный сотрудник</i> <b>СИЛАЕВ Николай Юрьевич</b>, <i>ведущий научный сотрудник ИМЭМО РАН</i> <b>КРЫЛОВ Александр Борисович</b>, а также эксперты РИСИ.</p>', '1242756000', '2', '0')";
$data[2] = "INSERT INTO `activity` VALUES ( '21', '182', 'Встреча с представителем комитета внешнеэкономических связей Турции в РФ', '<p>16 сентября 2009 года в РИСИ состоялась встреча с представителем Комитета внешнеэкономических связей Турции в РФ <strong>Ондером Текели</strong>. От РИСИ в мероприятии принимали участие директор института <strong>Л. П. Решетников</strong>, и.о. руководителя отдела проблем Азии и АТР <strong>А. В. Глазова</strong>, помощник директора <strong>А. Ю. Дударь</strong>. &nbsp;</p>
<p><br />
В ходе встречи Ондер Текели отметил заинтересованность Комитета внешнеэкономических связей Турции (DEIK) в установлении и развитии деловых отношений с РИСИ. По итогам беседы были достигнуты договоренности о возможности организации и проведения совместных научно&ndash;практических мероприятий (круглые столы, встречи, конференции), подготовки научных кадров и публикаций.&nbsp; <br />
&nbsp;</p>', '<p>16 сентября 2009 года в РИСИ состоялась встреча с представителем Комитета внешнеэкономических связей Турции в РФ <strong>Ондером Текели</strong>. От РИСИ в мероприятии принимали участие директор института <strong>Л.П.Решетников</strong>, и.о. руководителя отдела проблем Азии и АТР <strong>А.В. Глазова</strong>, помощник директора <strong>А.Ю. Дударь</strong>.</p>', '1253124000', '0', '0')";
$data[3] = "INSERT INTO `activity` VALUES ( '22', '182', 'Круглый стол &laquo;Россия-Азербайджан: перспективы развития двусторонних отношений&raquo;', '<p>15 октября 2009 года в зале конференций РИСИ состоялся круглый стол <strong>&laquo;Россия-Азербайджан: перспективы развития двусторонних отношений&raquo;</strong>.</p>
<p>&nbsp;</p>
<p>Организаторами мероприятия выступили <strong>Российский институт стратегических исследований (РИСИ) и Центр стратегических исследований при Президенте Азербайджанской Республики</strong> <strong>(ЦСИ)</strong>.</p>
<p>&nbsp;</p>
<p>С приветственным словом к&nbsp; участникам мероприятия обратились директор РИСИ<strong> Л. П. Решетников</strong>, заместитель Департамента внешнеэкономических и международных связей Правительства Москвы <strong>П. С. Куприков</strong>, директор ЦСИ <strong>Э. Э. Нуриев</strong>.</p>
<p>&nbsp;</p>
<p>На секции, посвященной <strong>российско-азербайджанскому экономическому сотрудничеству</strong> (<strong>модератор &ndash; заместитель директора РИСИ И. В. Прокофьев</strong>), с докладом &laquo;Нефть и газ: общее и особенное в подходах России и Азербайджана&raquo; выступил старший научный сотрудник РИСИ <strong>А.А. Куртов</strong>, проанализировав динамику развития нефте- и газодобычи в Азербайджане и России и обозначив возможные сферы сотрудничества. Независимый политический эксперт <strong>Р. Мусабеков</strong> в своем докладе остановился на перспективах российско-азербайджанского экономического сотрудничества, отметил необходимость восстановления кооперационных связей и совместной работы компаний двух стран на Каспии. Старший научный сотрудник РИСИ <strong>К. Е. Каратаева</strong> выступила с докладом, посвященным Международному транспортному коридору Север-Юг как основе развития сотрудничества России и Азербайджана в транспортной сфере. <strong>К. Е. Каратаева</strong> проанализировала динамику изменения подходов сторон к существующим проектам в этой сфере, отметила необходимость определения единой долгосрочной стратегии России и Азербайджана. Ведущий научный сотрудник РИСИ <strong>Ю. Н. Глущенко</strong> в докладе &laquo;О некоторых тенденциях развития ТЭК Азербайджана: интересы России&raquo; отметил, что взаимодействие двух стран в топливно-энергетической сфере не соответствует их потенциалу.</p>
<p>&nbsp;</p>
<p>На второй секции, посвященной <strong>перспективам российско-азербайджанского сотрудничества в контексте региональной безопасности</strong> (<strong>модератор &ndash; директор Института философии, социологии и права Национальной Академии наук Азербайджана И. Мамедзаде</strong>), выступил руководитель отдела проблем ближнего зарубежья РИСИ <strong>А. Ю. Скаков</strong> с докладом о влиянии внерегионального фактора на отношения России со странами Южного Кавказа. В ходе выступления А. Ю. Скаков подробно остановился на перспективах российско-американского сотрудничества на базе Габалинской РЛС, а также на блоке проблем, связанном с активизировавшимся армяно-турецким переговорным процессом. Ведущий консультант отдела политического анализа и информационного обеспечения Администрации Президента Азербайджанской Республики <strong>Ф. Мамедов</strong> посвятил свой доклад перспективам российско-азербайджанского сотрудничества в контексте региональной безопасности. Ф. Мамедов отметил, что с территории Азербайджана никогда не будет исходить угроза соседям, а целью республики является формирование в регионе пространства диалога и сотрудничества. Старший научный сотрудник РИСИ <strong>С. М. Ермаков</strong> в докладе &laquo;Проблемы военной безопасности на Южном Кавказе&raquo; отметил необходимость создания в регионе коллективной системы безопасности. Старший научный сотрудник РИСИ <strong>Д. А. Александров</strong> посвятил свой доклад сотрудничеству России и Азербайджана в сфере борьбы с экстремизмом и терроризмом.&nbsp;&nbsp;</p>
<p>&nbsp;</p>
<p>Третья секция была посвящена <strong>актуальным вопросам и перспективам гуманитарного сотрудничества между Россией и Азербайджаном</strong> (<strong>модератор &ndash; руководитель отдела проблем ближнего зарубежья РИСИ А. Ю. Скаков</strong>). Директор Института философии, социологии и права Национальной Академии наук Азербайджана <strong>И. Мамедзаде</strong> в своем докладе поднял тематику диаспоры и ее роли в формировании российско-азербайджанских отношений, а также подробно остановился на вопросах сотрудничества российской и азербайджанской науки, проблематике расширения ареала русского языка. И.О. руководителя отдела азиатских проблем РИСИ <strong>А. В. Глазова</strong> посвятила свой доклад российско-азербайджанским связям в области образования, отметив, что сотрудничество двух стран может развиваться только на прочном фундаменте социо-культурных и гуманитарных связей. <br />
В дискуссии на круглом столе приняли активное участие ведущий научный сотрудник РИСИ <strong>В. М. Клапцов</strong>, второй секретарь Посольства Азербайджанской Республики <strong>Э. Байрамов</strong>, научный сотрудник Информационно-аналитического центра МГУ по изучению общественно-политических процессов на постсоветском пространстве <strong>А. В. Караваев</strong>, представитель Русско-армянского содружества <strong>Ю. Л. Навоян</strong>, консультант по США Московского Международного нефтяного клуба <strong>А. Т. Байрамов</strong>, представитель ИТАР ТАСС <strong>С. Кадырова</strong>,&nbsp; член международного движения &laquo;За единую Осетию&raquo; <strong>М. Чернов</strong>.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />
&nbsp;</p>
<p>&nbsp;</p>', '<p>15 октября 2009 года в зале конференций РИСИ состоялся круглый стол <strong>&laquo;Россия-Азербайджан: перспективы развития двусторонних отношений&raquo;</strong>.</p>', '1255629600', '2', '0')";
$data[4] = "INSERT INTO `activity` VALUES ( '12', '182', ' Заседание Экономической секции Ученого совета РИСИ', '<p style=\"text-align: justify;\">2 июня 2009 года в Российском институте стратегических исследований состоялось заседание<strong> Экономической секции Ученого совета</strong>, посвященное обсуждению <strong>&laquo;Бюджетного послания Президента РФ о бюджетной политике в 2010&ndash;2012 годах&raquo;</strong>. В заседании Секции приняли участие директор института, к.и.н. Решетников Л.П., первый заместитель директора, д.и.н. Кокарев К.А., заместитель директора, к.г-м.н. Прокофьев И.В., ученый секретарь, к.э.н. Грибова Н.В., председатель экономической секции, д.э.н. Тищенко Г.Г., ведущий научный сотрудник, к.э.н. Глущенко Ю.Н., а также другие ведущие специалисты Института.</p>
<p style=\"text-align: justify;\">Заседание секции открыл директор института Решетников Л.П., отметивший в своем выступлении важность Бюджетного послания для развития всего государства, своевременность предлагаемых принципов бюджетного регулирования и социальную направленность документа. <br />
Заместитель директора Прокофьев И.В. призвал собравшихся к открытому и всестороннему обсуждению Бюджетного послания с тем, чтобы в ходе дискуссии и обмена мнениями постараться определить общие взгляды на его отдельные аспекты, проанализировать сильные стороны принципов, изложенных в послании, а также дать оценку перспективам успешного их использования на практике, в сложных условиях мирового экономического кризиса. <br />
С основным докладом выступил ведущий научный сотрудник Глущенко Ю.Н. В нем он отметил тяжелую экономическую ситуацию, в которой Правительству РФ предстоит реализовывать цели, указанные в Бюджетном послании. <br />
В частности, было отмечено, что к концу 2008 г. уровень бюджетных расходов достиг максимального за последнее десятилетие уровня &ndash; 18,3% ВВП, что в существенной степени финансировалось за счет налоговых и иных поступлений от нефтяных и газовых компаний. <br />
В условиях снижения мировых цен на основные сырьевые группы товаров бюджет страны нуждается в консервативном подходе к его формированию, что нашло свое отражение в Послании Президента РФ. Данный документ, по мнению Глущенко Ю.Н., необходимо рассматривать как президентскую макроэкономическую позицию, выраженную в основных тезисах, определяющих финансовую политику страны на ближайшие три года. Более точные акценты и подробные расчеты должны осуществляться на краткосрочной основе с тем, чтобы учитывать воздействие основных внешних и внутренних факторов, спрогнозировать которые в текущих условиях развития мировой экономики не представляется возможным. Рассматривая бюджетные перспективы, докладчик отметил, что при текущих ценах на нефть (по итогам 1 кв. 2009г. &ndash; 43,4 дол за баррель, собственная прогнозная оценка по итогам 2 кв. 2009 &ndash; 50-55 дол) собираемых доходов будет достаточно для финансирования расходных статей бюджета, так как их расчет осуществлялся исходя из среднегодовых цен на нефть. В то же время подобные расчеты в совокупности с зависимостью государственных финансов от нефтегазовых поступлений определяют и риски развития страны, так как текущая высокая цена абсолютно нехарактерна для столь существенного спада мировой экономики. Причинами Глущенко Ю.Н. назвал стратегические закупки, осуществляемые Китаем, особенности газового рынка, связанные с механизмом определения цены, а также спекулятивную составляющую, что определяет возможность повторного обвала мировых нефтяных цен при исчезновении одного или нескольких факторов. В этих условиях важным является проведение, отмеченных в Бюджетном послании, мероприятий в налоговой сфере: реформы налогообложения твердых полезных ископаемых, борьба с трансфертным ценообразованием. При этом было подчеркнуто, что позитивность указанных мер будет напрямую зависеть от непосредственных результатов ее реализации. <br />
В докладе также отмечается целесообразность консервативной политики и по другим вопросам: поддержание суверенных резервных фондов, прекращение поддержки курса рубля и местного фондового рынка в силу неэффективности данных мер, постепенное сокращение бюджетного дефицита и др., но главным все же представляется успешная реализация предложенных мер, которые, без сомнения, крайне реалистичны и своевременны. <br />
В выступлении ученого секретаря Грибовой Н.В. была отмечена особая роль данного документа, определяющего основные направления финансово-экономической и налогово-бюджетной политики страны на ближайшие 3 года. Значимость Бюджетного послания в период кризиса неизмеримо возрастает, поскольку основные положения будут служить ориентиром и для общества, и для рынка. <br />
Приоритетами были названы экономия, оптимизация расходов и целевое использование средств. Реализация этих ключевых принципов бюджетного планирования приобретает особую актуальность в период кризисных потрясений. <br />
Одним из принципиальных моментов стало, по мнению Грибовой Н.В., смещение приоритетов бюджетной политики на социальные функции. Таким образом, поддерживается спрос со стороны низкодоходных слоев населения, ориентированных преимущественно на приобретение недорогой отечественной продукции, что в конечном счете будет способствовать поддержанию внутреннего спроса и оказывать косвенную, опосредованную потребительским спросом, поддержку отечественным предприятиям. В то же время в выступлении была отмечена недостаточная проработанность приоритетов государственной инвестиционной политики, ориентированной на модернизацию и развитие экономики. Важность данной составляющей Бюджетного послания предопределена тем, что в условиях финансово-экономического кризиса, при сокращении инвестиционных возможностей предприятий и фактическом закрытии внешних рынков заемных средств ведущая роль в инвестиционном процессе отводится государству. <br />
Данный тезис был более глубоко рассмотрен ведущим научным сотрудником Ивановым Э.М., который отметил, что кризис в России имеет две составляющие: внешнюю и внутреннюю. Принципы, описанные в Бюджетном послании, в большей степени, по его мнению, направлены на преодоление негативного воздействия внешних факторов. Вопросы и проблемы самой экономики: снижение промышленного и материально-трудового потенциала, проработаны в документе не так сильно, что несколько снижает возможности проведения структурной перестройки экономики в условиях текущего кризиса. <br />
Выступление ведущего научного сотрудника Блинкова В.М. было посвящено проблеме привлечения оборотных средств именно для средних предприятий, являющихся зачастую системообразующими в отдельных регионах, районах и городах. Проблема, по его мнению, состоит в снижении кредитных ресурсов банков, а также невозможности привлечения финансирования в необходимых объемах. Без целенаправленной государственной политики по поддержке среднего бизнеса, определенной основополагающими государственными документами, такими как Бюджетное послание, сохранить их производственные мощности в условиях кризиса вряд ли удастся. В то же время их остановка может привести к усилению социальной напряженности, поэтому для реализации инвестиционных программ подобных предприятий необходима государственная поддержка, заложенная, в том числе и в Бюджетном послании. В разряд первоочередных принципов - помощь промышленным предприятиям не входит, что, однако, не мешает усилить данную составляющую при подготовке оставшихся документов, регулирующих бюджетную политику. <br />
С заключительным словом выступил первый заместитель директора Кокарев К.А., который акцентировал внимание собравшихся на политической важности документа и, в первую очередь, его преемственности по отношению к предыдущему посланию Федеральному Собранию РФ. Именно эта черта (наряду с выделением основных приоритетов развития на предстоящие три года), является на его взгляд основополагающей. Более того, Бюджетное послание содержит механизм совершенствования модели развития страны. <br />
Детали, на отсутствие которых обращают внимание некоторые специалисты, не предполагают, по мнению Кокарева К.А., своего раскрытия в подобных программных документах. Они должны быть детально проработаны в последующих актах, разработанных на основе Бюджетного послания. Послание Президента РФ отражает также наличие единой линии в документах и правительства и президента, что предопределяет его успешную реализацию</p>', '<p style=\"text-align: justify;\">2 июня 2009 года в Российском институте стратегических исследований состоялось заседание<strong> Экономической секции Ученого совета</strong>, посвященное обсуждению <strong>&laquo;Бюджетного послания Президента РФ о бюджетной политике в 2010&ndash;2012 годах&raquo;</strong>. В заседании Секции приняли участие директор института, к.и.н. Решетников Л.П., первый заместитель директора, д.и.н. Кокарев К.А., заместитель директора, к.г-м.н. Прокофьев И.В., ученый секретарь, к.э.н. Грибова Н.В., председатель экономической секции, д.э.н. Тищенко Г.Г., ведущий научный сотрудник, к.э.н. Глущенко Ю.Н., а также другие ведущие специалисты Института.</p>', '1244138400', '2', '0')";
$data[5] = "INSERT INTO `activity` VALUES ( '11', '182', 'Визит делегации Китайской академии современных международных отношений в РИСИ', '<p>31 августа 2009 г. в РИСИ прошла встреча с делегацией Китайской академии современных международных отношений (КАСМО). Возглавил делегацию <i>вице-президент КАСМО профессор</i> <b>Цзи Чжие</b>. От РИСИ в мероприятии приняли участие <i>первый заместитель директора</i> <b>К. А. Кокарев</b>, <i>руководитель отдела проблем Азии и АТР</i> <b>Б. З. Миркасымов</b>, эксперты отдела.&nbsp;</p>
<p>В ходе беседы были затронуты некоторые аспекты торгово-экономического сотрудничества России и Китая: падение товарооборота между двумя странами в первой половине 2009 г., вопросы развития приграничного взаимодействия и межрегионального сотрудничества. Эксперты обсудили вопросы, связанные с перспективами преодоления глобального финансово-экономического кризиса, и особенности взаимодействия сторон на различных международных площадках (ШОС, G-20, БРИК, РИК). Обе стороны отметили необходимость продуманного комплексного подхода при урегулировании вопросов внутренних межнациональных отношений. Серьезную озабоченность выразили китайские эксперты в связи со сложившейся ситуацией вокруг Корейского полуострова.</p>', '<p style=\"text-align: justify;\">31 августа 2009 г. в РИСИ прошла встреча с делегацией Китайской академии современных международных отношений (КАСМО). Возглавил делегацию <i>вице-президент КАСМО профессор</i> <b>Цзи Чжие</b>. От РИСИ в мероприятии приняли участие <i>первый заместитель директора</i> <b>К. А. Кокарев</b>, <i>руководитель отдела проблем Азии и АТР</i> <b>Б. З. Миркасымов</b>, эксперты отдела.</p>', '1251741600', '2', '0')";
$data[6] = "INSERT INTO `activity` VALUES ( '23', '182', 'Международный круглый стол &laquo;Коллаборационизм и предательство. Власов и власовщина&raquo;', '<p style=\"text-align: justify;\">12 ноября 2009 года Российский институт стратегических исследований под эгидой Комиссии при Президенте РФ по противодействию фальсификации истории в ущерб интересам России провел международный круглый стол<strong> &laquo;Коллаборационизм и предательство. Власов и власовщина&raquo;.</strong></p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">Финансовую и организационную поддержку мероприятию оказали <strong>Фонд содействия актуальным историческим исследованиям &laquo;Историческая память&raquo;, Группа компаний &laquo;ТЕЛРОС&raquo; (Санкт-Петербург), Екатеринбургское отделение Всемирного русского народного собора.</strong></p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">Гостями круглого стола стали: заместитель министра юстиции РФ д.и.н. А. М. Величко; председатель Совета директоров группы компаний &laquo;ТЕЛРОС&raquo; (СПб.) С. А. Таразевич; директор Центра системного анализа и прогнозирования Украины Р. В. Ищенко; председатель Попечительского совета Фонда поддержки стратегических исследований к.и.н. А. И. Нотин; главный редактор Российского информационного агентства &laquo;Русская линия&raquo; А. Д. Степанов.</p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">Вел заседание директор РИСИ Л. П. Решетников.</p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">С приветственным словом к&nbsp; участникам мероприятия обратился помощник руководителя Администрации Президента РФ, заместитель председателя Комиссии при Президенте РФ по противодействию попыткам фальсификации истории в ущерб интересам России И. И. Сирош.</p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">Целью работы круглого стола стала&nbsp; выработка общественной позиции по отношению к предпринимаемым&nbsp; в преддверии 65-летнего юбилея победы в Великой Отечественной войне попыткам умышленного искажения исторической правды о том, кто именно внес наибольший вклад в разгром гитлеровской Германии. Попытка обелить предателей, воевавших на стороне нацистов &ndash; Власова и так называемой РОА, представить их в роли так называемой &laquo;третьей силы&raquo;, которая, якобы, воевала и против Гитлера, и против Сталина, является одним из искусственных приемов, используемых для умаления действительной роли Красной Армии в разгроме гитлеровской Германии.</p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">С основными докладами по теме выступили 35 ведущих ученых-историка из национальных академических институтов России, ФРГ, Сербии, Украины, Белоруссии. Среди них: доктора исторических наук &ndash; В. Д. Кузнечевский (Москва), Б. Н. Ковалев (Великий Новгород), Франц Уле-Веттлер (Меккенхайм, ФРГ), Мирослав Йованович (Белград, Сербия), В. М. Лавров (Москва), Д. В. Табачник (Киев, Украина), Е. Ф. Кринко (Ростов-на-Дону); доктора философских наук &ndash; А. С. Гагарин (Екатеринбург), А. Л. Вассоевич (Санкт-Петербург); кандидаты исторических наук &ndash; С. В. Кормилицын (Санкт-Петербург), М. Б. Смолин (Санкт-Петербург), С. И. Дробязко (Москва), Алексей Тимофеев (Белград, Сербия), С. В. Кудряшев (ФРГ); кандидаты философских наук &ndash; С. Н. Дрожжин (Москва),&nbsp; В. В. Василик (Санкт-Петербург). Активное участие в дискуссии приняли видные представители Русской православной церкви &ndash; протоиерей, председатель Синодального отдела Московского патриархата по взаимодействию с вооруженными силами и правоохранительными органами отец Дмитрий (Смирнов) и наместник Сретенского монастыря архимандрит Тихон; а также генерал-майор А. В. Кирилин, писатель и историк П. В. Мультатули; руководители Фонда содействия актуальным историческим исследованиям &laquo;Историческая память&raquo; А. Р. Дюков и В. В. Симиндей; заместитель директора Института стран СНГ И. С. Шишкин, ведущий научный сотрудник РИСИ А. А. Куртов.</p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">Несмотря на то, что некоторые выступавшие попытались найти оправдание таким явлениям как коллаборационизм и предательство (страх перед пытками, естественное для человека желание выжить или жить лучше), в целом аудитория была едина: предательство с морально-нравственной точки зрения &ndash; это смертный грех, с точки зрения закона &ndash; преступление и&nbsp; не может быть оправданий людям, которые изменили своей Родине и присяге, а в случае с генералом Власовым еще и предали своих солдат. В этой связи резкой и аргументированной критике подверглись инициаторы реабилитации генерала Власова Г. Х. Попов и протоиерей Г. Митрофанов.</p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p style=\"text-align: justify;\">Участники круглого стола выказали растущую тревогу по поводу того, что молодое поколение России не знает&nbsp; национальную историю своей страны в ХХ веке, в особенности период Великой Отечественной войны, и не может отличить героев борьбы за независимость нашей Родины от предателей и изменников. В ситуации мощнейшего информационного давления, вакуума знания и размытого представления о добре и зле трудно достичь духовного единства, без которого весьма затруднительно осуществить модернизацию России.</p>
<p style=\"text-align: justify;\">&nbsp;</p>
<p>По итогам работы круглого стола готовится сборник докладов и выступлений его участников.</p>', '<p style=\"text-align: justify;\">12 ноября 2009 года Российский институт стратегических исследований под эгидой Комиссии при Президенте РФ по противодействию фальсификации истории в ущерб интересам России провел международный круглый стол <strong>&laquo;Коллаборационизм и предательство. Власов и власовщина&raquo;.</strong></p>
<p style=\"text-align: justify;\">Финансовую и организационную поддержку мероприятию оказали Фонд содействия актуальным историческим исследованиям &laquo;Историческая память&raquo;, Группа компаний &laquo;ТЕЛРОС&raquo; (Санкт-Петербург), Екатеринбургское отделение Всемирного русского народного собора.</p>', '1258225200', '1', '0')";
