$data[44] = "INSERT INTO `gallery` VALUES ( '320', '530', 'Vermont', '<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm;\">Застывшие во времени цветочные композиции Vermont - уникальные произведения искусства, которые будут радовать Вас годами.</p>
<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm;\">Инновационная технология&nbsp; стабилизации позволяет продлить жизнь растениям, сохранить естественное очарование, свежесть  красок и нежность фактуры в первозданном виде в течение 4-8 лет. Стабилизированные цветы, неотличимые от свежесрезанных, устойчивы к внешним воздействиям, не  требуют специального ухода и&nbsp; имеют совершенную форму.</p>
<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm;\">Стильные и утонченные композиции Vermont оживят интерьеры дома, ресторана, офиса, станут оригинальным подарком и будут долго радовать вас  неувядающей красотой.<o:p></o:p></p>
