$data[67] = "INSERT INTO `gallery` VALUES ( '348', '524', 'Домашние животные с индивидуальным характером', '<p><span lang=\"ru\" id=\"result_box\"><span title=\"Нажмите, чтобы увидеть альтернативный перевод\">Серия </span><span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">забавных</span> <span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">скульптур кошек,</span> <span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">собак</span> <span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">и животных</span></span><span lang=\"ru\" id=\"result_box\"><span title=\"Нажмите, чтобы увидеть альтернативный перевод\">, которые передают характер и индивидуальность домашних любимцев.</span></span> <span lang=\"ru\" id=\"result_box\"><span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">У каждого </span><span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">персонажа на ошейнике </span><span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">написано его имя, </span><span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">описание</span> <span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">его</span> <span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">характера и</span> <span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">повадок.</span> </span></p>
<p><span lang=\"ru\"><span title=\"Нажмите, чтобы увидеть альтернативный перевод\" class=\"hps\">Производство: Великобритания. </span></span></p>', '-1', '', '-1', '7', '')";
