$data[70] = "INSERT INTO `gallery` VALUES ( '353', '559', 'Скрапбукинг для детей: &quot;Открытки ручной работы и валентинки&quot;', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">8.02.2011  в 18:00 в мастерской Дома Цветочной Моды &laquo;Букет&raquo; состоялся детский  мастер-класс по скрапбукингу, посвященный созданию открыток ручной  работы и валентинок&nbsp; в необычной технике.</span></p>
<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Участники мастер-класса познакомились с новой креативной техникой скрапбукинга, узнали, как <span style=\"\">&nbsp;</span>с помощью самых обычных материалов создавать<span style=\"\">&nbsp; </span>необычные открытки, а также под чутким руководством дизайнеров-флористов сделали свои собственные оригинальные&nbsp; открытки-валентинки к празднику.</span></p>', '-1', '', '-1', '13', '')";
