<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Как часто мы хотим сделать близкому человеку особенный подарок, созданный именно для него.</span></p>
<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Дом Цветочной Моды предлагает подарить настоящее чудо &ndash; цветочную композицию, созданную своими руками исключительно для него. Такой невероятный подарок расскажет человеку именно о Ваших чувствах, и станет по-настоящему запоминающимся и неповторимым.</span></p>
<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Мы приглашаем Вас на индивидуальный мастер-класс &laquo;Создай свой букет&raquo; в любое удобное для Вас время. &nbsp;Креативные и внимательные флористы-дизайнеры Дома Цветочной Моды помогут наиболее точно воплотить Ваши самые смелые и творческие идеи в жизнь, создать настоящий флористический шедевр.</span></p>
<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Записаться на мастер-класс и получить более подробную информацию, вы можете по телефону 273-55-66.</span></p>
<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Подарите любимому человеку Букет хорошего настроения!</span></p>', '-1', '', '-1', '13', '')";
$data[72] = "INSERT INTO `gallery` VALUES ( '355', '559', 'Романтические композиции из живых цветов', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Невозможно  представить себе празднование Дня влюблённых без романтического вечера.  Хочется сделать его особенным, запоминающимся, полным нежности и любви&hellip;</span></p>
<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">11.02.2011 в 18:00 в мастерской Дома Цветочной Моды &laquo;Букет&raquo;</span><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\"><span style=\"\"> </span>по просьбе мужчин состоялся мастер-класс по созданию  романтических композиций из живых цветов.&nbsp; </span></p>
<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Участники мастер-класса приготовили </span><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">своим любимим женщинам совершенно особенные подарки на 14  февраля </span><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">- своими руками создали<span style=\"\"> </span>замечательные флористические композиции для украшения романтического стола.</span><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\"><br />
</span></p>', '-1', '', '-1', '13', '')";
$data[73] = "INSERT INTO `gallery` VALUES ( '356', '559', 'Новогодние арт-елки ручной работы', '<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">8 и 10 декабря 2010 года в Доме Цветочной Моды &laquo;Букет&raquo; прошли мастер-классы по созданию новогодней арт-елки. <span style=\"\">&nbsp;</span></span></p>
<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Проведя  вечер в теплой и дружественной атмосфере, участники познакомились с  тенденциями флористической зимней моды, узнали простые приемы  создания&nbsp;праздничного настроения, а главное без огромных усилий и  профессиональных навыков своими руками создали флористические шедевры &ndash;  новогодние декоративные елочки.</span></p>', '-1', '', '-1', '13', '')";
$data[74] = "INSERT INTO `gallery` VALUES ( '358', '559', 'Композиция из живых цветов на осеннюю тему', '<p>18 декабря в мастерской Дома Цветочной моды букет состоялся мастер класс, посвященный созданию осенних композиций.&nbsp;</p>
<p>Участники мастер-класса познакомились с осенней палитрой букетов и  композиций, научились подбирать фрукты, плоды, ветки в дизайне каркасных  букетов, попробовали создать собственные сезонные композиции с помощью  декоративного и природного материалов, срезанных цветов.</p>', '-1', '', '-1', '13', '')";
