<p style=\"margin: 0cm 0cm 0.0001pt;\">Собака&nbsp;Нельсон</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\">Характер: Нельсон - простачок, который пытается выглядеть представительно. Его тактика - походить на сторожевую собаку во всем, но это всего лишь мечты в действительности.</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\">Материал: керамика&nbsp;<br />
Размер: высота 23&nbsp;см&nbsp;</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\"><span class=\"hps\"><span title=\"Нажмите, чтобы увидеть альтернативный перевод\">Производитель: Великобритания.</span></span></p>
