$data[2590] = "INSERT INTO `news` VALUES ( '49', '412', '18.11.2010 Состоялся мастер класс по созданию осенних композиций', '<p>18 декабря в мастерской Дома Цветочной моды букет состоялся мастер класс, посвященный созданию осенних композиций.&nbsp;</p>
<p>Участники мастер-класса познакомились с осенней палитрой букетов и композиций, научились подбирать фрукты, плоды, ветки в дизайне каркасных букетов, попробовали создать собственные сезонные композиции с помощью  декоративного и природного материалов,  срезанных цветов.</p>', '', '1290020400', '0', '0')";
