<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">Новогодние елки &ndash; настоящие модницы, они не желают из года в год выглядеть одинаково. Дизайнеры лучших модных домов уделяют большое внимание разработке новых стилей в украшении новогодних елок.</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">Главный дизайнерский тренд этой зимы &ndash; <strong><span style=\"font-weight: normal;\">новогодние цветочные композиции</span></strong>.</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">Кажется, что создание элегантной флористической композиции к празднику требует огромных усилий и профессиональных навыков. Невероятно, но Вы можете сделать ее собственными руками.</p>
<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm;\">Дом Цветочной Моды &laquo;Букет&raquo; приглашает Вас посетить мастер-класс по созданию новогодней арт-елки 8 и 10 декабря 2010 года, где Вы сами сможете сделать необычный подарок или украшение для новогоднего интерьера.</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">Проведя вечер в теплой и дружественной атмосфере, Вы узнаете:</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">- тенденции флористической зимней моды;</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">- как внести в свой новогодний интерьер нотку современности и изысканности;</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">- как, с помощью простых приемов, создать&nbsp; праздничное настроение себе и&nbsp;&nbsp;&nbsp;</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">окружающим;</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">- а также своими руками создадите флористический шедевр - декоративную елку, которую заберете с собой.</p>
<p style=\"text-align: justify; text-indent: 1cm;\" class=\"MsoNormal\">Подробную информацию Вы можете узнать по телефону: 273-55-66.</p>', '', '1291057200', '0', '0')";
