<div style=\"margin-bottom: 0.0001pt; text-indent: 35.45pt; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Дом Цветочной Моды &laquo;Букет&raquo; принимает заказы букетов на 8 марта.</span></div>
<div style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 35.45pt;\">Мы ценим своих клиентов и считаем, что каждый букет должен вызывать только положительные эмоции и дарить хорошее настроение, а значит быть качественным.</div>
<div style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 35.45pt;\">В связи с предстоящим объемом работы в период праздника, мы планируем свое время и ресурсы заранее. Поэтому просим всех наших уважаемых клиентов заблаговременно сделать заказ на доставку цветов к 8 Марта.</div>
<div style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 35.45pt;\">Оформить предварительный заказ Вы можете по телефону 273-55-66 или на нашем сайте в разделе <!--[if gte mso 9]><xml>
