$data[2855] = "INSERT INTO `searchindex` VALUES ( '3', '346', '2010-01-20', 'О компании', 'http://tmc:80/o_kompanii/', '<div class=\"componentheading\">О компании</div><div style=\"clear:both\"></div><form method=\"post\" action=\"\" name=\"form315\" id=\"form315\" enctype=\"multipart/form-data\"><input type=\"hidden\" name=\"moduleId\" value=\"315\"/><div class=\"module textPage\"><table class=\"textpage\"><tr valign=\"top\"><td class=\"textpage_left\">&nbsp;</td><td><p>Мы работаем на данном рынке с августа 1999 г.&nbsp; Компания специализируется на разработке комплексных интегрированных решений для создания инженерной инфраструктуры предприятия. </p><p align=\"justify\">ТМС предлагает своим заказчикам современные технические средства и передовые программные продукты. </p><p align=\"justify\">Пользуясь  услугами ТМС, заказчик получает&nbsp; интегрированную&nbsp; систему жизнеобеспечения предприятия &laquo;под ключ&raquo;, надежность и работоспособность которой гарантирована, и в которой учтены индивидуальные потребности. </p><p align=\"justify\">В структуре&nbsp; компании есть специализированные подразделения, выполняющие&nbsp;проектирование, монтажные&nbsp; работы, поставку технических&nbsp;средств, установку&nbsp;и&nbsp;наладку, техническую поддержку и сервисное обслуживание. Работы выполняются на основании соответствующих государственных лицензий. </p><p align=\"justify\">По&nbsp; каждому&nbsp;направлению&nbsp;<wbr></wbr>деятельности ТМС&nbsp;располагает&nbsp;штатом специалистов, чья&nbsp;квалификация подтверждена сертификатами&nbsp; фирм - деловых&nbsp;партнеров, являющихся лидерами в&nbsp;отрасли. </p><p align=\"justify\">Заказчиками  ТМС&nbsp;являются государственные и коммерческие организации, крупные банки и финансовые структуры, промышленные предприятия различных секторов экономики, представительства инофирм. </p><p align=\"justify\">Стратегия  компании ориентирована&nbsp;на долгосрочное сотрудничество с&nbsp;деловыми партнерами и&nbsp;заказчиками.</p></td></tr></table></div></form>')";
