$data[2865] = "INSERT INTO `searchindex` VALUES ( '13', '346', '2010-01-20', 'Владимир Путин', 'http://tmc:80/o_kompanii/tmc_komanda_professionalov/?personalsId=69/', '<div class=\"componentheading\">TMC - команда профессионалов</div><div style=\"clear:both\"></div><form method=\"post\" action=\"\" name=\"form334\" id=\"form334\" enctype=\"multipart/form-data\"><input type=\"hidden\" name=\"moduleId\" value=\"334\"/><div class=\"module personalsModule\"><div class=\"text\">  <table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" class=\"table\">    <tr valign=\"top\"><td width=\"120\">                <a class=\"imageContainerLink\" style=\"text-decoration:none\" href=\"/ImageHandler.php?id=661\" rel=\"shadowbox[Images];options={counterType:\"skip\",continuous:true,animSequence:\"sync\",handleOversize:\"resize\"}\">          <img id=\"imageContainerImg\" src=\"/ImageHandler.php?id=661&width=220\" width=\"220\" border=\"0\">        </a>              </td>      <td style=\"padding-left: 10px;\">        <p style=\"font-weight:bold;\">Вице-премьер        <p><p>Родился <a title=\"7 октября\" href=\"http://ru.wikipedia.org/wiki/7_%D0%BE%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8F\">7 октября</a> <a class=\"mw-redirect\" title=\"1952\" href=\"http://ru.wikipedia.org/wiki/1952\">1952</a> в <a title=\"Санкт-Петербург\" href=\"http://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\">Ленинграде</a>. Отец Путина, Владимир Спиридонович Путин (23.02.1911&nbsp;&mdash; 02.08.1999)&nbsp;&mdash; участник <a title=\"Великая Отечественная война\" href=\"http://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\">ВОВ</a> (боец 330-го стрелкового полка <a title=\"86-я стрелковая дивизия (СССР) (страницаотсутствует)\" class=\"new\" href=\"http://ru.wikipedia.org/w/index.php?title=86-%D1%8F_%D1%81%D1%82%D1%80%D0%B5%D0%BB%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B4%D0%B8%D0%B2%D0%B8%D0%B7%D0%B8%D1%8F_%28%D0%A1%D0%A1%D0%A1%D0%A0%29&amp;action=edit&amp;redlink=1\">86-й дивизии</a> Красной армии, воевал, защищая <a title=\"Невский пятачок\" href=\"http://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%8F%D1%82%D0%B0%D1%87%D0%BE%D0%BA\">Невский пятачок</a>, был тяжело ранен), затем мастер на <a title=\"Вагонмаш\" href=\"http://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%B3%D0%BE%D0%BD%D0%BC%D0%B0%D1%88\">заводе им. Егорова</a>. Мать, Мария Ивановна Шеломова (1911&mdash;1998), также работала на заводе, пережила <a title=\"Блокада Ленинграда\" href=\"http://ru.wikipedia.org/wiki/%D0%91%D0%BB%D0%BE%D0%BA%D0%B0%D0%B4%D0%B0_%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D0%B0\">блокаду Ленинграда</a>. Дед <a title=\"Путин, Спиридон Иванович (страница отсутствует)\" class=\"new\" href=\"http://ru.wikipedia.org/w/index.php?title=%D0%9F%D1%83%D1%82%D0%B8%D0%BD,_%D0%A1%D0%BF%D0%B8%D1%80%D0%B8%D0%B4%D0%BE%D0%BD_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87&amp;action=edit&amp;redlink=1\">Спиридон</a> был поваром <a class=\"mw-redirect\" title=\"Ленин\" href=\"http://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD\">Ленина</a>. Владимир был третьим сыном в семье&nbsp;&mdash; двое старших братьев, родившихся ещё в тридцатые годы, умерли в детстве.</p><p>Семья Путиных жила в <a title=\"Коммунальная квартира\" href=\"http://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B2%D0%B0%D1%80%D1%82%D0%B8%D1%80%D0%B0\">коммунальной квартире</a> в Ленинграде. Уже став президентом, Путин рассказывал, что ещё с детства он увлекался советскими фильмами о <a class=\"mw-redirect\" title=\"Разведчик\" href=\"http://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B7%D0%B2%D0%B5%D0%B4%D1%87%D0%B8%D0%BA\">разведчиках</a> и мечтал работать в органах государственной безопасности.</p><p>В <a class=\"mw-redirect\" title=\"1970\" href=\"http://ru.wikipedia.org/wiki/1970\">1970</a>&mdash;<a class=\"mw-redirect\" title=\"1975\" href=\"http://ru.wikipedia.org/wiki/1975\">1975</a>&nbsp;гг. учился на международном отделении юридического факультета <a title=\"Санкт-Петербургский государственный университет\" href=\"http://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\">Ленинградского государственного университета имени Жданова (ЛГУ)</a>. В ЛГУ вступил в <a class=\"mw-redirect\" title=\"КПСС\" href=\"http://ru.wikipedia.org/wiki/%D0%9A%D0%9F%D0%A1%D0%A1\">КПСС</a> и оставался её членом до запрета партии в 1991 (формально не выходил из КПСС <sup class=\"reference\" id=\"cite_ref-3\"><a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%82%D0%B8%D0%BD#cite_note-3\">[4]</a></sup><sup class=\"reference\" id=\"cite_ref-4\"><a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%82%D0%B8%D0%BD#cite_note-4\">[5]</a></sup>). Во время учёбы впервые встретил <a title=\"Собчак, Анатолий Александрович\" href=\"http://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%B1%D1%87%D0%B0%D0%BA,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\">Анатолия Собчака</a>, в то время доцента ЛГУ. Тема диплома&nbsp;&mdash; &laquo;Принцип наиболее благоприятствуемой нации&raquo; (науч. рук. Л.&nbsp;Н.&nbsp;Галенская, кафедра международного права).<sup class=\"reference\" id=\"cite_ref-5\"><a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%82%D0%B8%D0%BD#cite_note-5\">[6]</a></sup></p>      </td></tr></table></div></div></form>')";
