$data[3178] = "INSERT INTO `textpages` VALUES ( '437', '<p style=\"margin: 0px 0px 1em;\"><strong>Условия доставки</strong><br />
Доставка осуществляется с 9 до 20 ч., в воскресенье &ndash; с 10 до 18 ч.  Возможность доставки заказа во внерабочее время оговаривается по  телефону. 273-55-66.<br />
Заказы на доставку принимаются по Уфе и пригороду, иные адреса оговариваются индивидуально по телефону 273-55-66.<br />
&nbsp;<br />
<strong>Сроки доставки</strong><br />
Рекомендуемое время оформления заказа и доставки &ndash; за сутки до желаемой  даты доставки. В праздничные дни &ndash; за 2-3 суток до даты доставки.<br />
Время доставки соответствует указанному при оформлении заказа (+/-15 мин.).<br />
Доставка заказа точно к назначенному времени оговаривается индивидуально  по телефону 273-55-66 или прописывается в комментариях к заказу при  оформлении через интернет-магазин.<br />
Оплата заказа и доставки производится заранее в салоне наличными  деньгами или по банковской карте, либо при получении заказа наличными  курьеру.&nbsp; <br />
Заказ считается выполненным, если получатель, либо лицо, находящееся по  указанному Заказчиком адресу, получили заказ и подписали бланк о  получении заказа.<br />
&nbsp;<br />
<strong>Отмена заказа</strong><br />
Вы вправе отказаться от выполнения ранее оплаченного заказа не менее чем  за 24 часа (в праздничные дни за 48 часов) до времени доставки,  позвонив по телефону 273-55-66. Отказ от заказа, отправленный по  электронной почте или любыми другими способами связи не рассматривается.<br />
&nbsp;<br />
<strong>Доставка цветов по России и странам СНГ</strong> осуществляется  через нашего партнера &ndash; компанию &laquo;AMF - международная сеть доставки  цветов&raquo;.&nbsp; Вам необходимо выбрать на сайте компании букет с учетом  желаемого города доставки и позвонить по телефону 273-55-66, чтобы  оформить заказ. Стоимость доставки уже включена в цену букета.</p>
<p style=\"margin: 0px 0px 1em;\"><strong>Доставка цветов по всему миру</strong><br />
Благодаря всемирной партнерской флористической сети, доставка цветов  осуществляется в 195 стран мира. Чтобы оформить заказ, позвоните по  телефону 273-55-66.</p>')";
