$data[3180] = "INSERT INTO `textpages` VALUES ( '411', '<p style=\"text-align: justify;\">Дом цветочной моды &laquo;Букет&raquo; - законодатель стиля в цветочном мире. Мы дарим вам Букет хорошего настроения!</p>
<p style=\"text-align: justify;\">Дом Цветочной Моды &quot;Букет&quot; начал свою историю покупкой букета цветов его создателем для своей супруги в одной из европейских столиц. Он был приятно удивлен посещением этого салона. Высокий уровень обслуживания и знание своего дела, а главное любовь к цветам и уважение к потребностям клиента - все делало этот салон необыкновенным. Выйдя из магазина, он чувствовал прилив сил, радость жизни и любви, уверенность и крылья за плечами. Ему захотелось, чтобы и в его родном городе покупка подарков для друзей и близких сопровождалась такими же ощущениями...</p>
<p style=\"text-align: justify;\">Цветочный салон остался одним из самых ярких впечатлений той поездки. Идея открытия подобного салона не оставляла его, он точно знал, что обязательно воплотит ее в жизнь. Он собрал единомышленников, каждый из которых профессионал в своей области, а вместе они составили&nbsp; сильную и сплоченную команду, которая создала не просто салон, а собственный стиль, основанный на любви к природе.</p>')";
