$data[3193] = "INSERT INTO `textpages` VALUES ( '505', '<p>
<div style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: medium;\"><span style=\"font-family: Times New Roman;\">Корпоративный праздник - важное событие в жизни компании. Важно создать по-настоящему праздничную атмосферу, объединяющую людей.</span></span></div>
<div style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: medium;\"><span style=\"font-family: Times New Roman;\">В лице Дома Цветочной Моды &quot;Букет&quot; Вы найдете надежного партнера в сфере флористического оформления праздника Вашей компании. </span></span></div>
<div style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: medium;\"><span style=\"font-family: Times New Roman;\">Изысканная красоты и величие редких живых цветов, утонченность флористических изюминок от Дома Цветочной Моды &quot;Букет&quot; и тематические цветочные композиции очаруют самых взыскательных гостей и сделают Ваш корпоративный праздник ярким и запоминающимся.</span></span></div>
</p>')";
