<![endif]--><strong><span style=\"font-size: 12pt; line-height: 115%; font-weight: normal;\">&raquo;</span></strong><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\"> предлагает Вам воспользоваться услугой аренды эксклюзивной арки для свадебной церемонии.</span></div>
<div style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Такой флористический прием позволит сохранить таинство брака, придать моменту торжественность, сделать его памятным для Вас и восхитительным для гостей. &nbsp;Ведь арка - это символ небесного свода. А браки, как известно, совершаются на небесах.</span></div>
<div style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Свадебная арка собирается на месте проведения церемонии, украшается живыми или искусственными цветами, по желанию драпируется тканью.</span></div>
<div style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Дополнительно можно заказать стойку для регистрации и подушечки для колец.</span></div>
<div style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Вы можете ознакомиться с примерами оформления свадебной арки в разделе <a href=\"http://buketufa.ru/predlozhenija/oformlenie_torzhestv/309/\">&quot;Оформление торжеств&quot;</a>.</span> <span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Вы можете сделать заказ, сославшись на это фото или предложить свой вариант украшения.</span></div>
<div style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">В первую очередь мы учитываем пожелания клиента. Поэтому арка всегда оформляется под конкретную свадебную церемонию, в общей с ней стилистике и является эксклюзивной работой.</span></div>
<div style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: normal;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Сделать заказ или получить более подробную информацию можно по телефону 273-55-66.&nbsp;</span><b><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\"> </span></b></div>
