$data[3205] = "INSERT INTO `textpages` VALUES ( '501', '<p style=\"text-align: center;\"><strong>Советы  по фотографии</strong></p>
<p style=\"text-align: justify;\">Свадебные фотографии &ndash; это память об одном счастливейшем дне, длящаяся всю жизнь. Мягкая, ароматная кожа свадебного альбома, атласные, приятные на ощупь листы и сказочные фотографии вашей свадьбы&hellip;</p>
<p style=\"text-align: justify;\">Чтобы все было идеально, во время свадебной фотосессии необходимо помнить о нескольких моментах:</p>
<ul style=\"text-align: justify;\">
    <li>Свадебный 	букет и украшения невесты должны 	выделяться на фоне платья. К примеру, 	белый букет сольется на фотографии с 	белым платьем и лишит снимок выразительности 	и праздничного ощущения.</li>
    <li>Украшения 	жениха и невесты должны гармонично 	сочетаться друг с другом и отражать 	единый стиль. В противном случае, 	фотография получится слишком пестрой.</li>
    <li style=\"text-align: justify;\">Букет 	на портбукетнице или с открытыми 	стеблями в ходе церемонии и во время 	фотосессии лучше всего держать на 	уровне бедер, наклонив его под углом 	не менее 45 градусов к оси тела. Тогда 	не будет видна ножка букета, и он хорошо 	получится на фотографиях.</li>
</ul>')";
