<![endif]--></p>
<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 35.45pt; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Торжественные праздники, дни рождения сотрудников не только приятные, но и хлопотные события. </span></p>
<p style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 35.45pt; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Дом  Цветочной Моды &laquo;Букет&raquo; поможет Вам проявить внимание к каждому  сотруднику, учесть его вкусы. С этой целью мы предлагаем услугу  флористического сопровождения Вашей компании. </span></p>
<ul type=\"disc\" style=\"margin-top: 0cm;\">
    <li style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Представитель  Дома цветочной      моды &laquo;Букет&raquo; вместе с Вами составляет календарь  поздравлений. Календарь      содержит: информацию о датах и пожелания  относительно цены, предпочитаемых      цветов и характера букета для  каждого поздравляемого. </span></li>
    <li style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\" class=\"MsoNormal\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\">Не  менее чем за 3 дня      представитель Дома цветочной моды &laquo;Букет&raquo;  позвонит Вам, напомнит о      предстоящем событии, справится об  изменениях и в &nbsp;указанный срок букет      будет доставлен в офис.</span></li>
</ul>
