<p style=\"text-align: justify; text-indent: 1cm;\">Оригинальное флористическое оформление выставочного стенда выгодно выделяет&nbsp;экспозицию среди других, вызывая интерес к фирме и ее продукции. Рекомендуем&nbsp;разместить на Вашем стенде или витрине эффектный флористический объект. Это&nbsp;декоративное решение как нельзя лучше подчеркнет прогрессивность Вашей компании и современность продукции.</p>
<p style=\"text-align: justify; text-indent: 1cm;\">С другой стороны, классическое использование цветочных&nbsp;композиций и букетов может прекрасно продемонстрировать фирменный стиль и&nbsp;традиции, высокий уровень обслуживания и заботу о комфорте клиентов.</p>
<p style=\"text-align: justify; text-indent: 1cm;\">С нашими флористическими изюминками Вы привлечете гораздо больше Ваших&nbsp;потенциальных клиентов и партнеров.&nbsp;Мы поможем Вам создать свой неповторимый стиль.</p>')";
$data[3212] = "INSERT INTO `textpages` VALUES ( '523', '')";
$data[3213] = "INSERT INTO `textpages` VALUES ( '525', '<p style=\"text-align: justify;\">Впечатление от подарка начинается с упаковки.&nbsp; Подарок, будь это игрушка ребенку или же деловой подарок директору компании, - это прежде всего знак внимания, и упакован он должен быть соответственно.<br />
Упаковка подарков от Дома Цветочной моды &laquo;Букет&raquo; придаст Вашему подарку индивидуальный стиль и представит его в выгодном свете.</p>')";
$data[3214] = "INSERT INTO `textpages` VALUES ( '527', '<p>Раздел в разработке&nbsp;</p>')";
$data[3215] = "INSERT INTO `textpages` VALUES ( '540', '<p style=\"text-align: justify;\">Цветы &mdash; очень важный элемент интерьера, которым не следует пренебрегать. Они обладают удивительной способностью преображать окружающее пространство &mdash; делать его светлее, шире, радостнее.</p>
<p style=\"text-align: justify;\"><strong>Оформление интерьеров офисов, reception </strong><br />
Дом цветочной моды &laquo;Букет&raquo; предлагает украсить Ваш офис горшечными растениями, цветочными и флористическими композициями.<br />
Облик компании, как и облик человека, складывается из мелочей. Очень важно расположить к себе клиента уже того момента, как он переступил порог Вашей компании.<br />
Дом цветочной моды &laquo;Букет&raquo; представляет широкий ассортимент растений и флористических композиций для оформления офисного интерьера, холла-приемной, стола-reception, комнаты переговоров, зала ожидания.<br />
Дом цветочной моды &laquo;Букет&raquo; наполнит Ваш офис атмосферой уюта, комфорта и радушия, от пребывания в нем у Ваших гостей останутся только теплые, приятные воспоминания и желание стать его постоянным клиентом.</p>
<p style=\"text-align: justify;\"><strong>Оформление квартир, комнат</strong><br />
Цветы обеспечивают психологический комфорт и гармонию, поднимают настроение. Они способны &laquo;вдохнуть жизнь&raquo; в каждую комнату, сделать Ваш дом радостным и уютным.</p>
<p style=\"text-align: justify;\"><strong>Оформление зимних садов</strong><br />
&nbsp;Дизайнеры-флористы&nbsp; Дома цветочной моды &laquo;Букет&raquo; разработают эксклюзивный дизайн-проект Зимнего сада и оформят его в Вашей организации или частном интерьере.<br />
У нас есть идеи дизайна, возможности и знания для реализации любых самых сложных и необычных проектов зимних садов.</p>
<p style=\"text-align: justify;\">&nbsp;</p>')";
