<p style=\"margin: 0cm 0cm 0.0001pt;\"><b>Время работы:</b> <br />
Пн.-Сб. с 9 до 20.00</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\">Вс. с 10.00 до 18.00</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\">&nbsp;</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\"><b>Адрес:</b> <br />
г.Уфа,&nbsp; ул.М. Карима,&nbsp; дом 41.</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\">&nbsp;</p>
<p style=\"margin: 0cm 0cm 0.0001pt;\"><b>Телефон:&nbsp;</b></p>
<p style=\"margin: 0cm 0cm 0.0001pt;\">(347) 273-55-66</p>
