$data[3217] = "INSERT INTO `textpages` VALUES ( '564', '<p style=\"text-align: justify;\">Дом Цветочной Моды &laquo;Букет&raquo; проводит для своих клиентов и гостей салона тематические мастер классы.<br />
Посетив мастер класс, у Вас есть уникальная возможность в теплой атмосфере единомышленников попробовать себя в роли флориста, познакомиться с современными тенденциями цветочной моды, соприкоснуться с историей и многообразием чарующего мира цветов.<br />
Опытные флористы &ndash; дизайнеры посвятят вас в тайны прекрасного, откроют волшебные секреты ароматного и цветущего искусства. Такой опыт&nbsp; не забудется никогда. А в подарок Вы получите уникальный цветочный шедевр, сделанный Вашими руками.<br />
Записаться на ближайший мастер класс, а также узнать более подробную информацию Вы можете по телефону 273-55-66.</p>')";
