<p>Дом Цветочной Моды &laquo;Букет&raquo; -&nbsp; роскошное место для свадебной фотосессии в Уфе. Изысканный интерьер салона, оформленный в европейском стиле, декорированные стены и потолок, свадебная арка, уютный дворик со скамейкой влюбленных &ndash; гармоничный уголок на открытом воздухе -, фасад салона, украшенный декоративными элементами, а также приветливый персонал, создающий соответствующую атмосферу праздника делают наш салон столь привлекательным местом для молодоженов.</p>
<p>Особая изюминка Дома Цветочной Моды &laquo;Букет&raquo; &ndash;&nbsp; потрясающе&nbsp; красивое место для фотосессии &ndash; кованный мост, имеющий свою легенду. На этом мосту можно провести церемонию соединения любящих сердец.</p>')";
$data[3219] = "INSERT INTO `textpages` VALUES ( '568', '<p>Спасибо. Заказ успешно оплачен! Наш менеджер свяжется с вами. 1</p>')";
$data[3220] = "INSERT INTO `textpages` VALUES ( '569', '<p><span style=\"color: rgb(151, 58, 52); font-size: 1.4em; \">Дом цветочной моды &laquo;Букет&raquo;</span>&nbsp;</p>
<p><br />
это не просто салон цветов, это целый мир, попадая в который, вы можете реализовать все свои цветочные фантазии.</p>')";
